	std::function<long(long)> ciura_approximation2 = [](long n)
	{
		const double r = 2.377411604869019028015819013165746863809012622871126918401; // (n+sqrt(n^2+4))/2, n=2-1/e^(pi)
		double value = 1;
		for (int iteration = 1; iteration < n; iteration += 1)
		{
			value = r * value + 1;
		}
		return ceil(value);
	};

	std::function<long(long)> ciura_approximation3 = [](long n) // simplicity seems to work
	{
		const double r = 2.25;
		double value = 1;
		for (int iteration = 1; iteration < n; iteration += 1)
		{
			value = r * value + iteration; // possible rationale for adding k on each iteration, every iteration costs one more (sort of like the "Two Egg Problem" with k eggs) so you have to account for the added cost on each step.
		}
		//std::cout << pow(value, (1.0 / (n-1))) << " ";
		// now that I think about it: when I made a mistake here and didn't do minus 1, I got ~2.25 on all iterations.
		return (n % 2) == 0 ? ceil(value) : floor(value);
	};

